template <typename MaybeConstUserType> struct Serializer<::network::mojom::ObliviousHttpCompletionResultDataView, MaybeConstUserType> {
    using UserType = typename std::remove_const<MaybeConstUserType>::type;
    using Traits = UnionTraits<::network::mojom::ObliviousHttpCompletionResultDataView, UserType>;

    static void Serialize(MaybeConstUserType& input, MessageFragment<::network::mojom::internal::ObliviousHttpCompletionResult_Data>& fragment, bool inlined)
    {
        if (CallIsNullIfExists<Traits>(input)) {
            if (inlined)
                fragment->set_null();
            return;
        }

        if (!inlined)
            fragment.Allocate();

        // TODO(azani): Handle unknown and objects.
        // Set the not-null flag.
        fragment->size = kUnionDataSize;
        fragment->tag = Traits::GetTag(input);
        switch (fragment->tag) {
        case ::network::mojom::ObliviousHttpCompletionResultDataView::Tag::kNetError: {
            decltype(Traits::net_error(input)) in_net_error = Traits::net_error(input);
            fragment->data.f_net_error = in_net_error;
            break;
        }
        case ::network::mojom::ObliviousHttpCompletionResultDataView::Tag::kOuterResponseErrorCode: {
            decltype(Traits::outer_response_error_code(input)) in_outer_response_error_code = Traits::outer_response_error_code(input);
            fragment->data.f_outer_response_error_code = in_outer_response_error_code;
            break;
        }
        case ::network::mojom::ObliviousHttpCompletionResultDataView::Tag::kInnerResponse: {
            decltype(Traits::inner_response(input)) in_inner_response = Traits::inner_response(input);
            mojo::internal::MessageFragment<typename decltype(fragment->data.f_inner_response)::BaseType> value_fragment(fragment.message());
            mojo::internal::Serialize<::network::mojom::ObliviousHttpResponseDataView>(in_inner_response, value_fragment);
            MOJO_INTERNAL_DLOG_SERIALIZATION_WARNING(value_fragment.is_null(), mojo::internal::VALIDATION_ERROR_UNEXPECTED_NULL_POINTER,
                "null inner_response in ObliviousHttpCompletionResult union");
            fragment->data.f_inner_response.Set(value_fragment.is_null() ? nullptr : value_fragment.data());
            break;
        }
        }
    }

    static bool Deserialize(::network::mojom::internal::ObliviousHttpCompletionResult_Data* input, UserType* output, Message* message)
    {
        if (!input || input->is_null())
            return CallSetToNullIfExists<Traits>(output);

        ::network::mojom::ObliviousHttpCompletionResultDataView data_view(input, message);
        return Traits::Read(data_view, output);
    }
};

